import React from 'react';
import styles from './HeaderMenuItem.module.css'

function HeaderMenuItem({item}, key) {
    return (
        <li key={key} className={styles.menuItem}>
            <button className={styles.menuHeader}>`{item.name}:`</button>
            <div className={styles.itemBody}>
            {
                item.buttons.map((button, index) =>
                    <button key={index} onClick={button.onClickFunction}>{button.name}</button>
                )
            }
            </div>
        </li>
    );
}

export default HeaderMenuItem;
